import React from 'react';
import './App.css'; // optional if you want to include styles
import logo from './images/ecilnewlogo.jpg'; // make sure the image is in `src/` or imported correctly

function TopBar() {
  return (
    <div className="container-fluid no-padding text-white topbar" style={{ width: '100%', height: '60px' }}>
      <div className="row" style={{ width: '10%', float: 'left' }}>
        <img src={logo} alt="logo" height="60" width="60" />
      </div>
      <div style={{ width: '90%' }}>
        <h5 style={{ textAlign: 'center' }}>Extraneous Manpower Management System</h5>
        <h6 style={{ textAlign: 'center' }}>Electronics Corporation Of India Limited</h6>
      </div>
    </div>
  );
}

export default TopBar;
